from MongoStampedAPI import *
api = MongoStampedAPI()
for b in a:
    oid = b['_id']['$oid']
    share_settings = b['linked']['facebook']['share_settings']
    acct = api.getAccount(oid)
    settings = LinkedAccountShareSettings()
    settings.dataImport(share_settings)
    acct.linked.facebook.share_settings = settings
    api._accountDB.updateAccount(acct)
